import React, { useState } from "react";

import { withRouter } from "react-router";

import "../css/home.css";



function Home(props) {


    return (

        <>
            <header>
                <div className="wrapper">
                    <div className="logo">
                        <img src="https://i.postimg.cc/mg4rWBmv/logo.png" alt="" />
                    </div>
                </div>
                <div className="search-box">
                    <input className="search-txt" type="text" 
                    onChange={(e)=> setSearch(e.target.value)} name="" placeholder="Type to search" />
                    <a className="search-btn" onClick = {getData} href="/"><div className="icon"><i className="fa fa-search" aria-hidden="true"></i></div></a>
                </div>
                <React.Fragment>
                {!skilledData ?(
                    <React.Fragment>
                <div className="welcome-text">
                    <h1>
                        We are <span>Creative</span></h1>
                    <a href="/Contact">Contact Us</a>
                </div>

                </React.Fragment>
                ):(
                    <div>
                {!userData && skilledData?.map((user)=>(
                     <div>
                         <div onClick={() => getUser(user)}  className="text-white">{user?.userName}
                         </div>
                    </div>
                ))}
{userData && (<UserInfo 
        name = {userData.userName}
        email = {userData.email} 
         />)}
                    </div>


                )}
                </React.Fragment>
            </header>
        </>
    )
}
export default withRouter(Home)
